import { axiosInstance } from "../../network"

export const setFavourite = ()=>(dispatch)=>{
  return axiosInstance
  .get("movie/popular?api_key=4c03591ec60bf980ec7a1be78c875fa5")
  .then((res) => dispatch({
    type: "SET_FAVOURITE",
    payload: res.data.results}))
  .catch((err) => console.log(err));
}
